import { Fragment, useState } from 'react';
import React from 'react';
import './Header_phone.css';
import Navigation from '../Navigation/navigation';
import Logo_phone from '../logo/logo_phone';

const Header_phone=(props)=>{
    const [clicked,Setclick]=useState(false);
    const ClickHandler=()=>{
        Setclick(!clicked);
    };
    return(
          <Fragment>
                <header className={`Header ${props.scrollDet>99?"heightDec":""}`}>    
                <Logo_phone click={clicked} scrollDet={props.scrollDet}></Logo_phone>
                <Navigation clickHandle={ClickHandler} scrollDet={props.scrollDet}></Navigation>
                </header>
          </Fragment>
              
    );
};

export default Header_phone;
